import React,{ useState } from "react";
import "../../App.css";
import { Table } from "react-bootstrap";
import "./Products.css";



export default function Products() {

  const [data, setData] = useState([])

  const getData = () => {
    fetch("https://api.openbrewerydb.org/breweries")
      .then((data) => data.json())
      .then((data) => {
        console.log(data);
        setData(data);
      });
  };

  getData();

  return (
    <>
      <div className="product-container">
        {JSON.stringify(data)}
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>Name</th>
              <th>City</th>
              <th>Postal Code</th>
              <th>Country</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Jakarta</td>
              <td>23333</td>
              <td>Indonesia</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Mark</td>
              <td>Jakarta</td>
              <td>23333</td>
              <td>Indonesia</td>
            </tr>
            <tr>
              <td>3</td>
              <td>Mark</td>
              <td>Jakarta</td>
              <td>23333</td>
              <td>Indonesia</td>
            </tr>
          </tbody>
        </Table>
      </div>
    </>
  );
}
